function [ys_, params, info] = steadystate(ys_, exo_, params)
% Steady state generated by Dynare preprocessor
    info = 0;
    ys_(7)=params(16);
    ys_(1)=1.0;
    ys_(20)=1.0;
    ys_(3)=params(5);
    ys_(2)=1-params(5);
    ys_(16)=params(8)^(params(9)/(1+params(9)));
    ys_(17)=(1-params(5))*ys_(16);
    ys_(18)=params(5)*ys_(16);
    ys_(4)=params(6)*exp(params(3));
    ys_(6)=params(5)*ys_(4);
    ys_(5)=(1-params(5))*ys_(4);
    ys_(9)=ys_(7)*params(5);
    ys_(8)=ys_(7)*(1-params(5));
    Z_C=0;
    ys_(10)=0;
    u_ZI=0;
    ys_(11)=0;
    ys_(12)=0;
    alpha_N_ss=(1-params(8))*params(7);
    ys_(15)=ys_(20)*ys_(3)*alpha_N_ss/ys_(9)/(1-params(8));
    theta_N_s=(1-params(8))*ys_(15)/ys_(7)^(1/params(4));
    ys_(19)=ys_(2)-ys_(16)^(1+1/params(9))/(1+1/params(9))-theta_N_s*ys_(7)^(1+1/params(4))/(1+1/params(4));
    r_ss=(1+params(2))^0.25-1.0;
    beta_ss=1/(1+r_ss)*exp(params(3))^params(1);
    delta_ss=1+params(5)/params(6)-exp(params(3));
    alpha_K_ss=params(6)*(r_ss+delta_ss);
    ys_(21)=params(3);
    ys_(22)=params(3)*(1-alpha_K_ss);
    ys_(13)=ys_(9)*ys_(15)*exp(ys_(21))*alpha_K_ss/alpha_N_ss/ys_(6);
    ys_(14)=ys_(13);
    ys_(23)=0;
    ys_(24)=0;
    ys_(25)=0;
    ys_(26)=0;
    ys_(27)=0;
    ys_(28)=0;
    ys_(29)=0;
    ys_(30)=0;
    ys_(31)=0;
    ys_(32)=0;
    lab_prod_obs=0;
    ys_(35)=0;
    ys_(34)=0;
    % Auxiliary equations
end
